const { width } = Dimensions.get("window")
const testImage = "data:image/png;base64,"
const CheckInSelfiePage = ({ route }: StaticScreenProps<{ selfie?: string }>) => {
  const navigation = useNavigation();
  const [permission, requestPermission] = Camera.useCameraPermissions();
  const [imageUrl, setImageUrl] = useState("")
  const [loading, setLoading] = useState(false)
  const { onboardingData, user } = useSelector((a: { user: { onboardingData: any, user: any } }) => a.user)
  const [selfie, setSelfie] = useState("")
  const onTakeSelfie = async () => {
    if (!permission?.granted) {
      const permissionResult = await requestPermission();
      if (!permissionResult.granted) {
        return;
      }
    }
    navigation.navigate('LoggedOut', { screen: 'CameraScreenPage' });
  };


  async function CheckInBySpot() {
    const checkin = await getData("checkin")
    let location = await Location.getCurrentPositionAsync({});

    try {
      setLoading(true)
      const lat = true ? 44.97747099999999 : location.coords.latitude
      const lng = true ? -93.27493349 : location.coords.longitude
      const result = await checkInLocation({ selfieUrl: selfie, spotId: checkin, userLatitude: lat, userLongitude: lng, userId: user.userId })
      if (result.statusCode === 200) {
        await storeData("activeCheckIn", checkin)
        showMessage({
          message: "Check in",
          description: `User Successfully Checked In`,
          type: "success",
        });
        navigation.navigate("Dashboard")
        setLoading(false)
      } else {
        showMessage({
          message: "Check in",
          description: `failed to Checked In you are not in the spot to Check In`,
          type: "warning",
        });
        setLoading(false)
      }
    } catch (err) {
      setLoading(false)
      handleApiError(err, "Check In")
    }
  }

  async function ChecKInImageUpload() {
    const result = await uploadImageService({ userId: user.userId, image: route.params?.selfie })
    setSelfie(result.data)
  }

  useEffect(() => {
    if (route.params?.selfie) {
      ChecKInImageUpload()
    } else {
      const result = route.params?.selfie ? route.params?.selfie : onboardingData.selfieUrls && onboardingData.selfieUrls[0] ? onboardingData.selfieUrls[0] : testImage;
      setSelfie(result)
    }
  }, [route.params?.selfie])

  return (
    <WithNoAuth>
      <SafeAreaView style={styles.container}>
        <View>
          <Header2 textColor="white" title="" />
          <View style={styles.selfieContainer}>
            <View style={styles.imageContainer}>
              <Image
                source={{ uri: selfie }}
                style={styles.image}
              />
            </View>
          </View>
          <View style={styles.seifieDividerContainer}>
            <View style={styles.divider} />
            <Text style={styles.dividerText}>Or</Text>
            <View style={styles.divider} />
          </View>
          <View style={styles.placeholderContainer}>
            <FaceIdIcon />
            <Text variant="titleMedium" style={styles.placeholderTitle}>
              Check-In Selfie
            </Text>
            <Text variant="bodyMedium" style={styles.placeholderText}>
              Take a selfie when you're ready, make sure your face fits into the
              frame
            </Text>
            <Button
              onPress={onTakeSelfie}
              icon={CameraControl}
              style={styles.takeSelfieButton}
              labelStyle={styles.underlineLabel}>
              Take selfie
            </Button>

          </View>
        </View>

        <CustomButton
          loading={loading}
          onPress={() => CheckInBySpot()}
          containerStyle={{ marginBottom: 10 }} title="Use current check-in selfie" textStyle={{ color: COLORS.white, fontFamily: FONTS._500Medium.fontFamily, fontWeight: "600" }} />
      </SafeAreaView>
    </WithNoAuth>
  );
};

